<h1>Unknown</h1>
<a name="lgp.core.evolution.registers.RegisterType.Unknown"></a>
<code><span class="identifier">Unknown</span></code>
<p>A register that does not fall in some known range will have unknown
type. This type primarily serves as a default case when mapping register
index ranges to register types.</p>
